@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://example.com/atm#> .

atm:ATM rdf:type owl:Class .

atm:TransactionData rdf:type owl:Class .

atm:encrypts rdf:type owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:TransactionData .

atm:inTransit rdf:type owl:Class ;
    rdfs:subClassOf atm:TransactionData .

atm:atRest rdf:type owl:Class ;
    rdfs:subClassOf atm:TransactionData .

atm:ATM rdfs:subClassOf [ rdf:type owl:Restriction ; owl:onProperty atm:encrypts ; owl:someValuesFrom atm:inTransit ] .
atm:ATM rdfs:subClassOf [ rdf:type owl:Restriction ; owl:onProperty atm:encrypts ; owl:someValuesFrom atm:atRest ] .
